import { initializeApp } from 'firebase/app';
import { getAnalytics } from "firebase/analytics";
import { getDatabase, ref, onValue} from "firebase/database";


export const SearchView = (props) => {
  let data = null;

  const updateData = (newData) => {
    data = newData;
  }

  const firebaseConfig = {
    apiKey: "AIzaSyAQ6USPFRL3Uqps1aqErhcNyRlO2XblHj0",
    authDomain: "interview-50399.firebaseapp.com",
    projectId: "interview-50399",
    storageBucket: "interview-50399.appspot.com",
    messagingSenderId: "503019432099",
    appId: "1:503019432099:web:9394f58478b734996db716",
    measurementId: "G-C8XFN5VGFS"
  };

  const getData = () => {

    const app = initializeApp(firebaseConfig);
    const analytics = getAnalytics(app);
    let data = []
    const dbRef = ref(getDatabase());
    get(child(dbRef, '/')).then((snapshot) => {
      if (snapshot.exists()) {
        // console.log( snapshot.val());
        // return snapshot.val();
        updateData(snapshot.val())
      } else {
        console.log("No data available");
      }
    }).catch((error) => {
      console.error(error);
    });
    console.log(data)
  }

  getData()

  let options = []

  for (let i = 0; i < data.length; i++){
    options.push(<option key={data[i]['First']} value={data[i]['First']}>{data[i]}</option>)
  }

  return (
    <div>
      <input list="users" name="userSearch"/>
      <datalist id="users">
        {options}
      </datalist>
    </div>
  )
}
